import React from "react";
import {Link} from 'react-router-dom';
import { BrowserRouter as Router, Route,Routes } from "react-router-dom";
import { Alert, Form } from "react-bootstrap";
import { useHistory } from "react-router-dom";

import axios from "axios";
class Registration extends React.Component{

    constructor(props){
        super(props);
        this.state= this.initiaLSTATE;
        this.state={};
    }

    login(){
        return this.props.history.push("/");
    }

    initiaLSTATE={
        id:"",
        name:"",
        email:"",
        username:"",
        password:"",
        confirmpassword:"",
        pnumber:"",

    };
    handlesubmit= (event) => {
        alert("saved ");
    
      alert('Name:'+this.state.name+'PNumber:')
    //     const doctor = {
    //         name: this.state.name,
    //         pnumber: this.state.pnumber,
    //         specialization: this.state.specialization,
    //         avaliability: this.state.avaliability,
           
    //       };
          
    //       axios.post("http://localhost:8080/api/doctor",doctor).then(response => {
    //         if(response.data!=null){
    //             this.setState(this.initiaLSTATE);
    //             alert("saved ");
    //           console.log(doctor)  ;

    //         }
    //       })
        
        

    }
    render(){
        const { name,pnumber , specialization,avaliability } =
        this.state;
        
        return(
        <Form onSubmit={this.handlesubmit} >
            <div className="main">
            <div >
              <div>
                <div>
                  <h1>Registartion Page</h1>
                  <div>
                    
                    <input type="text" placeholder="name" className="name" pattern="[A-Za-z]{5,10}" name="name" value={name} required/>
                  </div>
                  <div className="second-input">
                  
                    <input type="email" placeholder="Email" className="name" pattern="^[a-zA-Z0-9+_.-]+@[a-zA-Z0-9.-]+$" name="email" required/>
                  </div>
                  <div className="second-input">
                  
                    <input type="text" placeholder="Username" className="name"  name="username" pattern="[A-Za-z]{3,10}" required/>
                  </div>
                  <div className="second-input">
                  
                    <input type="password" placeholder="Password" className="name" name="password" pattern="[A-Za-z0-9#@$&]{3,10}"  required/>
                  </div>
                  <div className="second-input">
                  
                    <input type="password" placeholder=" Confirm Password" className="name" name="confirmpassword" pattern="[A-Za-z0-9#@$&]{3,10}"  required/>
                  </div>
                  <div className="second-input">
                  
                    <input type="text" placeholder="Specialization" className="name" name="specialization"  value={specialization} required/>
                  </div>
                  <div className="second-input">
                  
                    <input type="text" placeholder="Phone number" className="name"  name="pnumber" value={pnumber} required/>
                  </div>
                  <div className="second-input">
                  
                    <input type="text" placeholder="Avaliability" className="name" name="avaliability"  value={avaliability} required/>
                  </div>
                  
                 <div className="login-button">
                 <button  >submit</button><br></br>
                 <br></br>
                 <button ><Link to={"/"}>Login Page</Link></button>
                 </div>
                </div>
              </div>
              
       
            </div>
           </div> 
           </Form>
           
        );
    }
}

export default Registration;
